    n, m = [int(x) for x in input().split()]
    g = [int(x) for x in input().split()]
    d = {}
    for i in range(n):
        for j in range(g[i]):
            if i+1 not in d:
                d[i+1] = []
            d[i+1].append(int(input()))
    #print(d)
    ans = 0
    for i in range(1, n+1):
        for j in range(1, n+1):
            if i == j:
                continue
            if i in d and j in d:
                if len(set(d[i]) & set(d[j])) > 0:
                    continue
            ans += 1
    print(ans)

