    n, m = map(int, input().split())
    plants = []
    for i in range(n):
        s, x = map(float, input().split())
        plants.append((s, x))
    plants.sort(key=lambda x: x[1])
    borders = []
    for i in range(m - 1):
        borders.append(plants[i][1])
    borders.sort()
    count = 0
    for i in range(n):
        if plants[i][1] < borders[0]:
            count += 1
        elif plants[i][1] > borders[-1]:
            count += 1
        else:
            for j in range(m - 1):
                if plants[i][1] > borders[j] and plants[i][1] < borders[j + 1]:
                    count += 1
                    break
    print(count)

